import React from 'react';
import './ItemEditButton.css'

const ItemEditButton = props => {
    const editItem = () => {
        props.editItem();
    }
    return (
        <button onClick={editItem()} className="Item-Edit-Button">Edit</button>
    )
};

export default ItemEditButton;
